import React from 'react';

const NavBar = () =>{
  return(
    <>
      <div className="navbar">
        <div className="nav">
          <h4>IMDb</h4>
        </div>
      </div>
      <div className="box">
        <div className="b2">
          <h2>Featured Today</h2>
        </div>  
      </div>
    </>
  );
};

export default NavBar;
